// Cart.js
import React from 'react';

const Cart = ({ cartItems }) => (
  <div>
    <h2>Cart</h2>
    <ul>
      {cartItems.map((item, index) => (
        <li key={index}>
          {item.title} - Rs. {item.Price}
        </li>
      ))}
    </ul>
  </div>
);

export default Cart;
